import React from 'react'
import { Button } from '@material-ui/core';
import { Table } from '@material-ui/core';

const Papers = props =>{


    return(
        props.dataPapers.map(
            paper => 
            <div>            
                <Button color="primary">Hello World</Button>
                <p>{paper.id} {paper.title}</p>
            </div>
        )
    )
}

export default Papers;
